function showSupply() public view returns (uint256 remainingSupply) {
    // Equivalent to: require(!(mintedSupply > totalSupply), "");
    require(mintedSupply <= totalSupply, "");

    remainingSupply = totalSupply - mintedSupply;

    // Equivalent to the decompiled assert logic
    assert(remainingSupply <= totalSupply);
}

